            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine du programme </h3>
                <p class=""description""> 
                    Le génie civil représente l'ensemble des techniques de constructions civiles. Les ingénieurs 
                    civils ou ingénieurs en génie civil s’occupent de la conception, la réalisation, l’exploitation 
                    et la réhabilitation d’ouvrages de construction et d’infrastructures dont ils assurent la gestion afin de 
                    répondre aux besoins de la société, tout en assurant la sécurité du public et la protection de l’environnement. 
                    Très variées, leurs réalisations se répartissent principalement 
    ");
            WriteLiteral(@"                dans cinq grands domaines d’intervention : structures, géotechnique, hydraulique, transport, et environnement.
                </p>
