                <h3 class=""smaller_heading""> II.2.1. Objectif général </h3>
                <p class=""description""> 
                    La spécialité Génie Civil BTP vise à donner aux étudiants une culture scientifique et 
                    technique pour maîtriser les technologies et leurs évolutions, notamment dans les ouvrages 
                    construits. Ces connaissances articulent ingénierie et sciences humaines et économiques. 
                    Les enseignements ciblent la connaissance des matériaux, des fluides et des structures dans une 
                    visée de production, de maintenance ou de gestion. Ils développent également les outils de planification 
                    et de gestion d");
            WriteLiteral(@"e projet. Les spécialités de cette mention partagent des objectifs de formation des étudiants à 
                    la fois dans le domaine de la recherche et vers des applications professionnelles. 
                </p>

                <h3 class=""smaller_heading""> II.2.2. Objectifs spécifiques </h3>
                <p class=""description""> 
                    <strong> Commun à la mention </strong><br/>
                    L’enseignement s’appuie sur un socle solide de connaissances et de pratiques scientifiques et techniques qui 
                    permettent de maîtriser les méthodes de dimensionnement des structures et des équipements des bâtiments en 
                    respectant les réglementations en vigueur, de rédiger les documents correspondants et réaliser les plans 
                    d'exécution. La formation inclut un projet de fin d’études et un stage en entreprise afin de mieux préparer 
                    à l’insertion professionnelle. 
                    Elle développe l’e");
            WriteLiteral(@"sprit de veille technologique et les facultés d’adaptation. Elle s’ouvre également aux 
                    échanges internationaux.
                </p>

                <h3 class=""small_heading""> II.3. Approche du programme </h3>
                <p class=""description""> 
                    Le parcours Ingénierie de conception du Bâtiment et des Travaux publics (GCBT) est l’un des trois parcours du Master Genie Civil BTP de B2IM et prépare les étudiants aux métiers d’ingénierie du secteur Bâtiment et Travaux Publics. Il procure toutes les compétences nécessaires pour la conception et la réalisation des ouvrages de génie civil tout en initiant les étudiants aux domaines de la recherche et de l’innovation. Le cursus couvre sur deux ans tous les principaux aspects du génie civil. Il s’appuie sur un solide socle d’enseignements scientifiques et techniques visant à la polyvalence et à l’autonomie scientifique et technique ainsi qu’à l’ouverture d’esprit.
                    Il prépare à la vie professionne");
            WriteLiteral(@"lle par des séminaires professionnels, des visites de chantiers, des projets, des rencontres avec les entreprises ainsi que par des stages en entreprise. Il procure aussi une excellente initiation à la recherche enrichie, pour ceux qui le souhaitent, par un stage recherche préparant ainsi à la poursuite d’études en doctorat.
                   <br/> Le M1 de la mention Génie Civil BTP est commun aux trois parcours de la deuxième année (M2) :
                </p>
